module.exports = GradeWithout

var grader = require('Grade')

function GradeWithout(data, timeslot, studentsInTimeslot, removeStudent) {
    var newStudentArr = []
    for(i=0;i<studentsInTimeslot.length;i++){
        if(studentsInTimeslot[i].localeCompare(removeStudent) != 0){
            newStudentArr.push(studentsInTimeslot[i])
        }
    }
    console.log("without: " + newStudentArr)
    var grade = grader(data,timeslot,newStudentArr)
    return grade
}